import React,{useState,useCallback} from 'react'
import Header from './Header'
import FriendImg from '../Assets/Images/Connect_with_friends.png'
import Input from '../Input'
import Button from '../Button'
import { createStore } from 'redux'
import loginApp from '../../Controllers/Reducer/reducer'
import * as actions from '../../Controllers/Actions/Actions'

function SignIn(){
    const store = createStore(loginApp,+  window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__())
    const [error,setError] = useState('')
    const renderError = useCallback(
        () => {
            return(
                <p className={error===''?"":"alert"}>{error}</p>
            )
        },
        [error],
    )
    const [userDetails , setUserDetails] = useState({
        name:"",
        userName:"",
        email:"",
        password:"",
        re_enter_password:"",
        birthday:"",
        gender:""
    })
    const unsubcribe = store.subscribe(() => console.log(store.getState()))
    function callError(){
        //catch the password not match error
        if(userDetails.password !== userDetails.re_enter_password)
            setError("Passwords do not match")
        else
            sendData()
    }
    function sendData(){
        store.dispatch(actions.addSignUpDetails(userDetails.name,userDetails.userName,userDetails.email,userDetails.password,userDetails.birthday,userDetails.gender))
    }
    function setName(event){
        setUserDetails(prev=>{
            prev.name=event.target.value;
            return prev
        })
    }
    function setEmail(event){
        setUserDetails(prev=>{
            prev.email=event.target.value;
            return prev
        })
    }
    function setUserName(event){
        setUserDetails(prev=>{
            prev.userName=event.target.value;
            return prev
        })
    }
    function setPassword(event){
        setUserDetails(prev=>{
            prev.password=event.target.value;
            return prev
        })
    }
    function setReEnterPassword(event){
        setUserDetails(prev=>{
            prev.re_enter_password=event.target.value;
            return prev
        })
    }    
    function setGender(event){
        setUserDetails(prev=>{
            prev.gender=event.target.value;
            return prev
        })
    }
    function setBirthday(event){
        setUserDetails(prev=>{
            prev.birthday=event.target.value;
            return prev
        })
    }
    return(
        <div>
            <Header />  
            <div className="main-content">
                <div className="main-content-left">
                    <h3>Friend Finder helps you connect and share with the people in your life.</h3>
                    <img src={FriendImg} />
                </div>
                <div className="main-content-right">
                    <h1>Create an account</h1>
                    <p>It's quick and easy.</p>
                    {renderError()}
                    <div className="main-content-form">
                        <div className="flex-wrap">
                            <Input method={setName} class="input-form" text="Full Name" type="text"/>
                            <Input method={setUserName} class="input-form width" text="User name" type="text" />
                        </div>
                        <Input method={setEmail} class="input-form" text="Email address" type="text"/>
                        <Input method={setPassword} class="input-form" text="New Password" type="password" />
                        <Input method={setReEnterPassword} method2={callError} class="input-form" text="Re enter new Password" type="password"/>
                        <div className="form-option-list">
                            <p>Birthday</p>
                            <input className="ff-date" type="date" onChange={setBirthday}/>
                        </div>
                        <div className="form-option-list">
                            <p>Gender</p>
                            <input type="radio" name="gender" value="Male" onChange={setGender}/><span>Male</span>
                            <input type="radio" name="gender" value="Female" onChange={setGender}/><span>Female</span>
                            <input type="radio"  name="gender"value="Other" onChange={setGender}/><span>Other</span>
                        </div>
                        <Button method={callError} class="ff-sign-up-button" name="Sign Up"/>
                    </div>
                </div>
            </div>     
        </div>
    );
}

export default SignIn
